import * as api from "../../apis/index"
export const getMemories = () => {
  return async (dispatch) => {
    try {
      const data = await api.getMemories();
      dispatch({
        type: "MEMORIES_FETCH_SUCCESS",
        payload: data
      });
    } catch (error) {
      console.log(error);
    }
  };
}
